Effectively, this PR provides support for using the `$in` operator to query documents in collections where the schema defines a field that is a bsonType of `array` where the items are a bsonType of `string`. This is a backwards compatibility breaking change in terms of behavior, but not in terms of the interface.

To provide an example, please consider the following schema for context:

```go
var thingsSchema = bson.M{
	"$jsonSchema": bson.M{
		"bsonType": "object",
		"required": []string{"thingID"},
		"properties": bson.M{
			"thingID": bson.M{
				"bsonType":    "string",
				"description": "primary identifier for the thing",
			},
			"created": bson.M{
				"bsonType":    "date",
				"description": "time at which the thing was created",
			},
			"name": bson.M{
				"bsonType":    "string",
				"description": "name of the thing",
			},
			"attributes": bson.M{
				"bsonType":    "array",
				"description": "type tags for the thing",
				"items": bson.M{
					"bsonType": "string",
				},
			},
		},
	},
}
```

_Notice how attributes field is defined as a `bsonType` of `array`, and the items are `bsonType` of `string`._

**Prior to this PR**
A request to `GET /v1/things?filter[attributes]=round,glass` would result in the following query:

```json
{
  "attributes": ["round", "glass"]
}
```

_The above query operates such that the documents would have to contain both "round" and "glass" as attributes._

**After the PR**
A request to `GET /v1/things?filter[attributes]=round,glass` results in the following query:

```json
{
  "attributes": { "$in": [ "round", "glass" ] }
}
```

_The above query performs an OR type of query where it will return documents that contain either round OR glass as an attribute value._

